20	6313.00	35	2025-04-01 01:10:54.252+05	Наушники Marshall Major IV	Наушники с микрофоном Marshall Major IV, Bluetooth, 3.5 мм, коричневый	Marshall Major IV\r\nВстречайте Major IV, культовые наушники от Marshall с более чем 80 часами беспроводного воспроизведения, беспроводной зарядкой и эргономичным дизайном.\r\n\r\nС более чем тремя полными днями использования вы можете не беспокоиться о том, что ваши наушники перестанут работать, когда они вам понадобятся.\r\n\r\nСпециально настроенные динамики обеспечивают ревущие басы, плавные средние и блестящие высокие частоты для хорошего звука.\r\n\r\nMajor IV обеспечивает звук характерный для Marshall, которого вы и ожидали. В Major IV заложены более чем 55-летние знания о взрывном звуке. Специально настроенные динамические драйверы обеспечивают качественный звук, который вы никогда не захотите отключать.	f	t	8	t
22	13736.00	16	2025-04-01 01:15:54.721+05	Микроскоп цифровой Skymart BeaverLab M2B	Микроскоп цифровой Skymart BeaverLab M2B (Standard), съемный IPS-дисплей 4,3", WiFi и USB, разрешение Full HD, запись фото и видео, беспроводной детский школьный учебный	Цифровой микроскоп BeaverLAB M2B (Standard)\r\nЗнакомьтесь, BeaverLab M2 – первый в мире цифровой микроскоп со съемным экраном! Инструмент оснащен цветным IPS-дисплеем с диагональю 4,3-дюйма, который можно отсоединить от штатива и превратить в самостоятельный переносной микроскоп.\r\n \r\nВ качестве приемника изображений используется ПЗС-матрица с разрешением Full-HD (2 млн. пиксел). Рабочий диапазон увеличений микроскопа: от 10 до 800 крат. Благодаря встроенному WiFi-модулю изображения можно передавать в режиме реального времени на различные смартфоны, планшеты, компьютеры и современные телевизоры. Полученные фотографии и видео можно сохранять с разрешением 1920x1080 как во внутренней памяти устройства (32 Гб), так и на внешних носителях.\r\n\r\nПитание осуществляется от двух встроенных литий-ионных аккумуляторов (в штативе и в тубусе), емкости которых хватает примерно на 5 часов наблюдений.\r\n\r\nДля проведения первых наблюдений прямо «из коробки» данная версия микроскопа M2B (Standard) комплектуется 10 готовыми микропрепаратами. В нашем ассортименте также имеется премиальная версия M2A (Deluxe), у которой, помимо 10 микропрепаратов, имеются: 10 предметных и покровных стекол, 2 контейнера для хранения образцов и инструментов, 3 баночки для образцов, 2 чашки Петри, пипетка, пинцет, цветная иллюстрированная книга о микромире (на английском) и тетрадь для записи наблюдений.\r\nIPS дисплей с диагональю 4,3 дюйма\r\nЦифровой микроскоп BeaverLab M2 оснащен цветным IPS-экраном с диагональю 4,3-дюйма. Экран имеет 24-разрядную глубину цвета и способен отображать 16,7 млн. различных оттенков. Технология IPS обеспечивает более яркие и реалистичные цвета по сравнению с другими дисплеями, а также позволяет получить более широкие углы обзора. При этом IPS-экраны обеспечивают стабильные характеристики цветопередачи в не зависимости от положения зрителя относительно экрана.\r\nУвеличение от 10 до 800 крат\r\nОптическая схема микроскопа позволяет получать увеличения в диапазоне от 10 до 800 крат (оптическое увеличение до 200 крат). Плавное изменение увеличения осуществляется с помощью вращения фокусировочного цилиндра на тубусе микроскопа, а также с помощью кнопок «плюс» и «минус», расположенных на задней панели экрана.\r\nСъемная конструкция\r\nЭкран микроскопа BeaverLAB M2 имеет съемный тубус, который можно отсоединить от основания (штатива) без нарушения функциональности. Таким образом, микроскоп легко превращается из настольного в переносной (портативный). Мобильная версия микроскопа обеспечит вам полную свободу действий в походе, на экскурсии или других мероприятиях на открытом воздухе.\r\nПриемная матрица Full HD\r\nМикроскоп BeaverLAB M2 оснащен 2-мегапиксельной CMOS-матрицей, дающей возможность сохранять фотографии и видео наблюдаемых объектов в формате Full HD (разрешение 1920x1080 пиксел). Такое разрешение позволит в дальнейшем изучать и анализировать полученные изображения на экране ноутбука или компьютера в более крупном масштабе без потери качества.\r\nБеспроводная передача данных\r\nБлагодаря встроенному WiFi-модулю и бесплатному мобильному приложению Beaver Point (для iOS и Android) вы легко сможете загружать изображения и видео с микроскопа BeaverLab M2 на различные смартфоны или планшеты, без необходимости использования USB-кабеля. Беспроводная передача данных позволит вам напрямую делиться своими открытиями с другими людьми и загружать полученные фотографии и видеоклипы в социальные сети.	f	t	6	t
